    return (
      <div className="logo">
        <div className="img">
          <img src={img1} alt="" className="gear1"/>
          <img src={img5} alt="" className="gear4"/>
          <img src={img3} alt="" className="gear2"/>
          <img src={img4} alt="" className="gear3"/>
